import React from 'react';
import Cards from './Cards' 
import Data from './data';
import Heading from './Heading';
import './index.css';

function ncards(val){
    return (<Cards nam = {val.nam} imsSrc = {srcc} comapny = "Netflix" />)
}

let srcc = "https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"
function App(){
    return (
    <>
        <div className="Conatiner">
        <Heading/>
        {Data.map(ncards)}        
        </div>
        </>)
}
export default App
